import React from 'react';

import style from './MealsSummary.module.css';

const MealsSummary = () => {
    return (
        <section className={style.summary}>
            <h2>Delicius Food, Delivered To You</h2>
            <p>Choose yout favourite meal from our broad selection of available meals and enjoy a delicious lunch or dinner at home.</p>
            <p>All our meals are cooked with high-queality ingredients, just-in-time and of course by experienced chefs!</p>
        </section>
    );
};

export default MealsSummary;
